import Card from "../WheelCard";
import Wheel from "../Wheel";

import Footer from '../Footer';


const Scripts =() => {
  return (
  	<>
  		<ScriptsHead />

  		<Footer />
  	</>
  );
}

class ScriptsHead extends Component {
	render() {
    	return (
    		<div className="headingcontainer">
    			<h1>Scripts</h1>
     		</div>
    	);
    }
}

export default Scripts;
